class ScenarioVersionDetail {
    constructor(id, scenarioName, description, fileVersion, shockClassification, deltaComment, active, updatedBy, timestamp) {
      this.id = id;
      this.scenarioName = scenarioName;
      this.description = description;
      this.fileVersion = fileVersion;
      this.shockClassification = shockClassification;
      this.deltaComment = deltaComment;
      this.active = active;
      this.updatedBy = updatedBy;
      this.timestamp = timestamp;
    }
  }
  
  export default ScenarioVersionDetail;
  